import React, {Component} from 'react';
import './App.css';



const  App = () => {
  return (
      <div className='app-wrapper'>
      <header className='header'>
        <img src = 'https://cdn3.f-cdn.com//files/download/70016655/Logo%202.png'/>
      </header>
      <nav className='nav'>
        <div>Profile</div>
        <div>Messages</div>
        <div></div>
        <div></div>
      </nav>
      <div className="content">Main content</div>
      </div>
  );
}

export default App;
